import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button'
import ButtonGroup from '@material-ui/core/ButtonGroup'
import SaveIcon from '@material-ui/icons/Save'
import DeleteIcon from '@material-ui/icons/Delete'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ButtonGroup>
        <Button
          startIcon={<SaveIcon />}
          // endIcon={<SaveIcon/>}
          size='large'
          // disabled
          style={{
            fontSize: 28
          }}
          variant='contained'
          color='primary'
        >
          Save
        </Button>
        <Button
          startIcon={<SaveIcon />}
          // endIcon={<SaveIcon/>}
          size='large'
          // disabled
          style={{
            fontSize: 28
          }}
          variant='contained'
          color='secondary'
        >
          Delete
        </Button>
        </ButtonGroup>

        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
